    about_description: {
        ua: "\u041F\u0440\u0438\u0432\u0456\u0442! ",
        ru: "\u041F\u0440\u0438\u0432\u0435\u0442! ",
        pl: "Pozdrowienia! Jestem po\u015Brednikiem w obrocie nieruchomo\u015Bciami komercyjnymi w Warszawie. Moj\u0105 prac\u0105 jest pomaganie inwestorom, przedsi\u0119biorcom i organizacjom w znalezieniu idealnego miejsca na ich dzia\u0142alno\u015B\u0107. Znam wszystkie niuanse i subtelno\u015Bci rynku nieruchomo\u015Bci komercyjnych i w swojej pracy wykorzystuj\u0119 nowoczesne technologie, aby znale\u017A\u0107 najlepsze opcje. Mam rzetelne i przejrzyste relacje z klientami, a tak\u017Ce mam dost\u0119p do du\u017Cej bazy nieruchomo\u015Bci, co pozwala mi szybko znale\u017A\u0107 potrzebne klientom lokale do wynaj\u0119cia. Mieszkam w Warszawie i mo\u017Cesz przyjecha\u0107 do mojego biura lub mo\u017Cemy spotka\u0107 si\u0119 gdziekolwiek Ci najwygodniej. Jestem gotowy pom\xf3c Ci znale\u017A\u0107 idealne miejsce dla Twojej firmy!",
        en: "Gr\xfc\xdfe! Ich bin ein Gewerbeimmobilienmakler in Warschau. Meine Aufgabe ist es, Investoren, Unternehmern und Organisationen dabei zu helfen, den idealen Ort f\xfcr ihre Aktivit\xe4ten zu finden. Ich kenne alle Nuancen und Feinheiten des Gewerbeimmobilienmarktes und nutze bei meiner Arbeit moderne Technologien, um die besten Optionen zu finden. Ich habe zuverl\xe4ssige und transparente Beziehungen zu meinen Kunden und habe au\xdferdem Zugriff auf eine gro\xdfe Immobiliendatenbank, die es mir erm\xf6glicht, schnell die von den Kunden ben\xf6tigten Mietobjekte zu finden. Ich lebe in Warschau und Sie k\xf6nnen in mein B\xfcro kommen oder wir treffen uns dort, wo es f\xfcr Sie am bequemsten ist. Ich bin bereit, Ihnen dabei zu helfen, den perfekten Standort f\xfcr Ihr Unternehmen zu finden!"
    },
